    @Override
    protected void onRegister(ObjectRegistryElement object, int id, String stringID, boolean isReplace) {
        Item item = object.object.generateNewObjectItem();
        if (item != null) {
            ItemRegistry.replaceItem(object.object.getStringID(), item, object.itemBrokerValue, object.itemObtainable, object.itemCountInStats, object.itemObtainableInCreative, object.isObtainedByOtherItemStringIDs);
        }
    }

    @Override
    protected void onRegistryClose() {
        this.streamElements().map(e -> e.object).forEach(obj -> {
            String valid = obj.getMultiTile(0).checkValid();
            if (valid != null) {
                throw new IllegalStateException(obj.getStringID() + " has invalid multi tile setup: " + valid);
            }
        });
        this.streamElements().map(e -> e.object).forEach(GameObject::updateLocalDisplayName);
        for (ObjectRegistryElement element : this.getElements()) {
            element.object.onObjectRegistryClosed();
        }
        stringIDs = (String[])instance.streamElements().map(e -> e.object.getStringID()).toArray(String[]::new);
    }

    public static int registerObject(String stringID, GameObject object, float itemBrokerValue, boolean itemObtainable) {
        return ObjectRegistry.registerObject(stringID, object, itemBrokerValue, itemObtainable, itemObtainable, new String[0]);
    }

    public static int registerObject(String stringID, GameObject object, float itemBrokerValue, boolean itemObtainable, boolean itemCountInStats, String ... isObtainedByOtherItemStringIDs) {
        return ObjectRegistry.registerObject(stringID, object, itemBrokerValue, itemObtainable, itemCountInStats, itemObtainable, isObtainedByOtherItemStringIDs);
    }

    public static int registerObject(String stringID, GameObject object, float itemBrokerValue, boolean itemObtainable, boolean itemCountInStats, boolean itemObtainableInCreative, String ... isObtainedByOtherItemStringIDs) {
        if (LoadedMod.isRunningModClientSide()) {
            throw new IllegalStateException("Client/server only mods cannot register objects");
        }
        return instance.register(stringID, new ObjectRegistryElement(object, itemBrokerValue, itemObtainable, itemObtainableInCreative, itemCountInStats, Arrays.asList(isObtainedByOtherItemStringIDs)));
    }

    public static int replaceObject(String stringID, GameObject object, float itemBrokerValue, boolean itemObtainable) {
        return ObjectRegistry.replaceObject(stringID, object, itemBrokerValue, itemObtainable, itemObtainable, new String[0]);
    }

    public static int replaceObject(String stringID, GameObject object, float itemBrokerValue, boolean itemObtainable, boolean itemCountInStats, String ... isObtainedByOtherItemStringIDs) {
        return ObjectRegistry.replaceObject(stringID, object, itemBrokerValue, itemObtainable, itemCountInStats, itemObtainable, isObtainedByOtherItemStringIDs);
    }

    public static int replaceObject(String stringID, GameObject object, float itemBrokerValue, boolean itemObtainable, boolean itemCountInStats, boolean itemObtainableInCreative, String ... isObtainedByOtherItemStringIDs) {
        return instance.replace(stringID, new ObjectRegistryElement(object, itemBrokerValue, itemObtainable, itemObtainableInCreative, itemCountInStats, Arrays.asList(isObtainedByOtherItemStringIDs)));
    }

    public static GameObject getObject(int id) {
        ObjectRegistryElement element;
        if (id >= instance.size()) {
            id = 0;
        }
        if ((element = (ObjectRegistryElement)instance.getElement(id)) == null) {
            throw new NullPointerException(ObjectRegistry.instance.objectCallName + " ID " + id + " seems to be missing or corrupted");
        }
        return element.object;
    }

    public static int getObjectID(String stringID) {
        return instance.getElementID(stringID);
    }

    public static String getObjectStringID(int id) {
        return instance.getElementStringID(id);
    }

    public static GameObject getObject(String stringID) {
        ObjectRegistryElement element = (ObjectRegistryElement)instance.getElement(stringID);
        if (element == null) {
            throw new NullPointerException(ObjectRegistry.instance.objectCallName + " stringID " + stringID + " seems to be missing or corrupted");
        }
        return element.object;
    }

    public static int getObjectIDRaw(String stringID) throws NoSuchElementException {
        return instance.getElementIDRaw(stringID);
    }

    public static Stream<GameObject> streamObjects() {
        return instance.streamElements().map(e -> e.object);
    }

    public static Iterable<GameObject> getObjects() {
        return ObjectRegistry.streamObjects().collect(Collectors.toList());
    }

    public static int getObjectsCount() {
        return instance.size();
    }

    public static String[] getObjectStringIDs() {
        if (stringIDs == null) {
            throw new IllegalStateException("ObjectRegistry not yet closed");
        }
        return stringIDs;
    }

    static {
        instance = new ObjectRegistry();
        stringIDs = null;
    }

    protected static class ObjectRegistryElement
    implements IDDataContainer {
        public final GameObject object;
        public final float itemBrokerValue;
        public final boolean itemObtainable;
        public final boolean itemObtainableInCreative;
        public final boolean itemCountInStats;
        public final List<String> isObtainedByOtherItemStringIDs;

        public ObjectRegistryElement(GameObject object, float itemBrokerValue, boolean itemObtainable, boolean itemObtainableInCreative, boolean itemCountInStats, List<String> isObtainedByOtherItemStringIDs) {
            this.object = object;
            this.itemBrokerValue = itemBrokerValue;
            this.itemObtainable = itemObtainable;
            this.itemObtainableInCreative = itemObtainableInCreative;
            this.itemCountInStats = itemCountInStats;
            this.isObtainedByOtherItemStringIDs = isObtainedByOtherItemStringIDs;
        }

        @Override
        public IDData getIDData() {
            return this.object.idData;
        }
    }
